import { USER_LOGIN_REQUEST, USER_LOGIN_SUCCESS, USER_LOGIN_FAIL, USER_LOGIN_RESET } from '../constants/loginConstant'
import axios from 'axios'

export const loginAction = (data) => async (dispatch, getstate) => {
    try {
        dispatch({type:USER_LOGIN_REQUEST})
        console.log()
        const {data,config,headers,status,statusText,request} = await axios.post('http://localhost:3001/login',data)
        console.log('response')
        console.log(data)
        console.log(config)
        console.log(headers)
        console.log(status)
        console.log(statusText)
        console.log(request)
        dispatch({type:USER_LOGIN_SUCCESS, payload:data})
        

    } catch (error) {

    }
}
